import React, {Component} from 'react';
import {Switch, Route, Link} from 'react-router-dom';
import GetWordContainer from './pages/GetWordContainer';
import DefinitionsContainer from './pages/DefinitionsContainer';

class App extends Component {

  state = {
    redirect: {}
  }

  setRedirect = redirect =>
    this.setState({redirect})

render() {
    return (
      <>
        <Route 
          render={ routeProps => <Redirector redirect={this.state.redirect} setRedirect={this.setRedirect} {...routeProps} />}
        />
        <header>
          <nav>
            <Link to='/'>Saved</Link>
          </nav>
        </header>

        <main>
          <h1>My Dictionary</h1>
          <GetWordContainer />
          <DefinitionsContainer />
        </main>
      </>
    );
  }
}

export default App;
